६ महिनामा बाँकीमा धेरै खान सकिन्छ अझै ! भर्खरै त अर्थमन्त्री फर्किया छ !! 

विपक्षी एमाले लाई थोरै भाग छुट्टाए अरु कसैको हिम्मत छैन ! हात्ती हिंड्छ कुकुर भुक्छ !!

@Mrperfect141414 बेक्कार सरको यातना मात्रै भोगियो। 
यो जिन्दगीमा दोहोर्याएर अल्जेब्राको कहीँ कतै प्रयोग गर्नुपरेको छैन। 
कथंकथाचित प्रयोग भएको रहेछ भने म अल्जेब्रा मान्ने पक्षमा छैन, लु जा।  😝

@hello_acharya @Madankkharel @DharelLama @acharya_susma @SabitaDhimal @mohanmainali @bistakaji41 @RajjitC @newborn122 @sani_sharma1 @GThapa25 @AnandaRamPoudel शत प्रतिशत सहमत। 
राजा जस्तो राजालाइ मारे पछि ब्यापारी राजा चाहिएको थिएन । माओवादीहरु हत्यारा नै भए पनि दुःख भोगेकाले दुखी जनताको उद्दार गर्ने छन भन्ने सोच गलत थियो। 
उनीहरु आफु राजा बन्न आएका हुन भनेर लाटा जनताले बुझेका थिएनन्। Extortion र Scam गर्ने डाँका हुन चिनेका थिएनन्

@Bhismak1962 @juction4love प्रत्येक 'क्रान्ती' ले अधिकांशको करियर खत्तम गर्छ । किनकी आफ्नो उत्पादनशील उमेर त्यसमा खर्चेका हुन्छन् ।
साथमा नेतृत्वमा बस्ने मुठ्ठीभरको  पोलिटिकल
 'करियर' निर्माण गर्छ ।
